-- 导出  表 aiworld_v3.word_book 结构
CREATE TABLE IF NOT EXISTS `word_book` (
  `create_time` timestamp(6) NULL DEFAULT CURRENT_TIMESTAMP(6) COMMENT '创建时间',
  `update_time` timestamp(6) NULL DEFAULT CURRENT_TIMESTAMP(6) ON UPDATE CURRENT_TIMESTAMP(6) COMMENT '更新时间',
  `create_by` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '创建人',
  `update_by` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '更新人',
  `remark` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT '' COMMENT '备注',
  `version` int DEFAULT '1' COMMENT '版本号',
  `id` int NOT NULL AUTO_INCREMENT,
  `is_enable` tinyint NOT NULL DEFAULT '1' COMMENT '是否启用 1=启用 2=禁用',
  `name` varchar(255) NOT NULL COMMENT '词书名称',
  `desc` varchar(255) DEFAULT NULL COMMENT '词书描述',
  `pic` varchar(255) NOT NULL COMMENT '词书封面',
  `tab_id` smallint DEFAULT NULL COMMENT '所属tab',
  `num` int DEFAULT NULL COMMENT '词书数量',
  `sort` int NOT NULL COMMENT '排序',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=584 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci;

